import React, { Fragment } from "react";
import BeigeCard from "./BeigeCard";
import "./Card.scss";

const ChefCard: React.FC<{
  img: string;
  title: string;
  detail: string;
  restaurantImg: string;
  restaurantName: string;
  key: string;
}> = (props) => {
  return (
    <Fragment>
        <BeigeCard
          img={props.restaurantImg}
          title={props.restaurantName}
          detail={""}
          key={props.key}
        ></BeigeCard>
    </Fragment>
  );
};

export default ChefCard;
